import React from 'react'
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


export default function PatientTable() {
    return (

        <div>

<TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table" variant="outlined">
        <TableHead>
          <TableRow>
            <TableCell>Name </TableCell>
            <TableCell align="right">Patient ID</TableCell>
            <TableCell align="right">DOB</TableCell>
            <TableCell align="right">Address</TableCell>
            <TableCell align="right">Treatment ID</TableCell>
            <TableCell align="right">Has Allergy</TableCell>
            <TableCell align="right">View Patient</TableCell>
            <TableCell align="right">Delete Patient</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {patients.map((row) => (
            <TableRow
              key={row.patientId}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.patientId}</TableCell>
              <TableCell align="right">{row.dob}</TableCell>
              <TableCell align="right">{row.address}</TableCell>
              <TableCell align="right">{row.treatmentId}</TableCell>

                {val.allergy == 0 && (
                <TableCell align="right">PATIENT HAS NO ALLERGY!</TableCell>
                )}
                {val.allergy == 1 && (
                <TableCell align="right" className="hasAllergy"> 
                <strong> PATIENT HAS ALLERGY! </strong> 
                </TableCell>
                )}
                <TableCell> 

                <Button
                  className="smallButton"
                  color="primary"
                  variant="outlined"
                  onClick={() => {
                    fetchTreatmentRecordsById(row.treatmentId);
                  }}
                >

                  View Treatment
                </Button>


                </TableCell>


                <TableCell>


                <Button
                  className="smallButton"
                  color="primary"
                  variant="outlined"
                  onClick={() => {
                    deletePatient(row.patientId);
                  }}
                >

                  Delete Patient
                </Button>

                </TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>

    </TableContainer>
        </div>
    )
}
